import { makeStyles } from '@material-ui/core'
import React from 'react'
import { useSelector } from 'react-redux'
import logo from '../allImages/logo.png';

function NavBar() {

    const userReducer = useSelector(state => state.userReducer.state.user)

    const useStyles = makeStyles(theme => ({
        navBar: {
            display: 'flex',
            justifyContent: 'space-between',
            [theme.breakpoints.down('xs')]: {

            },
            navButtons: {
                marginTop: '60px',
                marginRight: '180px',
                display: 'flex'
            },
        },
    }))
    return (
        <div className={classes.navBar} >
            <img src={logo} className='logo' alt='' ></img>
            { !userReducer ? (
                <div className={classes.navButtons} >
                    <div
                    ><Button variant='contained' color='primary'
                        className={classes.button}  >Login as Restaurant</Button></div>
                    <div><Button variant='contained'
                        component={Link} to='login'
                        color='primary' className={classes.button} >Login as User</Button></div>
                </div>
            ) : (
                <div className={classes.navButtons} >
                    <div
                    ><Button variant='contained' color='primary'
                        onClick={logoutHandler}
                        className={classes.button}  >Logout</Button></div>
                </div>
            )}

        </div>
    )
}

export default NavBar
